import {React, useEffect} from "react";
import { NavLink } from "react-router-dom";
import WalletConnect from "../FrontPage/WalletConnect";
import "./navbar.css";

const Navbar = () => {


  useEffect(()=>{

    if (!window.ethereum) {
      <WalletConnect/>;
    }

  });


  return (
    <>
     <div className="navbar">
       <h2>NFT Marketplace</h2>
     <nav>
          <ul className="items">
            <li>
              <NavLink to="/" activeClassName="active">
                {" "}
                Explore{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/popular" activeClassName="active">
                {" "}
                Popular{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/sale" activeClassName="active">
                {" "}
                Sale{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/collection" activeClassName="active">
                {" "}
                My Collection{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/creators" activeClassName="active">
                {" "}
                Creators{" "}
              </NavLink>
            </li>
          </ul>

      </nav>

          <div className="buttons">
          <NavLink to="/create">
              <button><span>Create</span></button>
            </NavLink>
          <button>200 Tokens</button>
          </div>

     </div>
    </>
  );
};

export default Navbar;
